import React, { useEffect, useState } from "react";
import Footer from "../Footer";
import Gallery_app from "./Gallery_app";
import SimpleReactLightBox from "simple-react-lightbox";


export default function Gallery() {
  return (
    <>
      <React.StrictMode>
        <SimpleReactLightBox>
          <Gallery_app />
        </SimpleReactLightBox>
      </React.StrictMode>
      <Footer />
    </>
  );
}
